  border-radius: 7px;
  background: #fff;
  width: 50px;
  height: 28px;
  outline: none;
  border: 1px solid #fff;
  margin: 5px;
  color: black;
  text-align: center;
  margin-top: 10px;
  margin-left: 600px;
  font-family: 宋体;
}
.tab{
  width: 99%;
  margin-left: 0.2%;
  text-align: center;
  border: 1px solid #15c8fb;
  margin-top:-10px;
}
.tab td{
  border: 1px solid #15c8fb;
  color: #fff;
  font-size: 15px;
  height: 35px;
}
.tab th{
  border: 1px solid #15c8fb;
  color: #6ed9fb;
  font-size: 18px;
  height: 50px;
}
/* 分页开始 */
.page-bar{
  position: absolute;
  bottom: 17px;
  left: 35%;
  user-select:none;
}
.page-bar li{
  float: left;
  list-style: none
}
.page-bar li:first-child>a {
  margin-left: 0px
}
.page-bar a{
  border: 0;
  text-decoration: none;
  position: relative;
  text-align: center;
  margin-left: -1px;
  cursor: pointer;
  display: inline-block;
  width: 1.6vw;
  height: 1.6vw;
  line-height: 1.6vw;
  border-radius: 100%;
  background: #2373a1;
  margin: 0.5vw;
  color: #ffffff;
  font-size: 0.7vw;
}
.page-bar a .banclick{
  cursor:not-allowed;
}
.page-bar a i{
  font-style:normal;
  color: #d44950;
  margin: 0px 4px;
  font-size: 0.7vw;
}
.active a{
  cursor: default;
  background: #70dcfb;
}
.page-bar .shuang a{
  color: #fff;
}
